import React from 'react';

export default function SearchComponent() {
  return (
    <>
      <span>Search</span>
      <div>
        <div className='form-group'>
          <label>
            <Fiel type='email' name='email' className='Input' /> <p />
            <ErrorMessage name='email' component='div' />
          </label>
        </div>
      </div>
    </>
  );
}
